import React, { Component } from 'react';

import Nav from '../components/Nav';
import Banner from '../components/Banner';

class Header extends React.Component {
    render() {
        return (
            <header class="hea">
                <Nav/>
                <Banner/>
            </header>
        )
    }
}
export default Header
